import React from 'react'
import './Form.css'
import TextWithCounter from './TextWithCounter.js'

class Form extends React.Component{

  constructor(props) {
    super(props)
    this.handleSubmit = this.handleSubmit.bind(this)
  }

  handleSubmit(event) {
    console.log('submit')
    return false;
  }

  render() {
     return <div>
      <form className="mx-auto" method="POST" id="form">
        <h1 className="form-title">Feedback</h1>
        <div className="form-group">
          <input type="text" className="form-control" id="inputFirstName" placeholder="First Name" /><br />
          <input type="text" className="form-control" id="inputLastName" placeholder="Last Name" /><br />
          <input type="email" className="form-control" id="inputEmail" placeholder="john@example.com" /><br />
          <TextWithCounter></TextWithCounter><br />
          <button type="submit" className="btn btn-primary" onClick={this.handleSubmit}>Submit</button>
        </div>
      </form> 
    </div>
  }
}

export default Form;
